contracts/demo.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

contract FirstWeekAssignment {
    string userName;
    uint userAge;
    constructor(string memory _userName, uint _userAge){
        userName = _userName;
        userAge = _userAge;
    }

    function getUserName() public  view returns(string memory) {
        return userName;
    }

    function getUserAge() external view returns (uint ) {
        return userAge * 2;
    }

    function setUserName(string memory _userName) public {
        userName = _userName;
    }

    //  function setDetailsOfEvent(string memory _name, string memory _description) public{
    //     nameOfEvent = _name;
    //     eventDescription = _description;
    // }
}

contract Sum {

    int a;
    int b;

    function setAB(int _a, int _b) public {
        a = _a;
        b = _b;
    }

    // function setB(int _b) public {
    //     b = _b;
    // }

    function getSum() public view returns(int){
        return a + b;
    }

}

